import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <>
            <Layout>
                <Head>
                    <title>Inicio</title>
                </Head>         
            </Layout>
            <h1>Home</h1> 
        <style jsx>{`
            *, *:after ,*:before{
                -ms-box-sizing:border-box;
                -moz-box-sizing:border-box;
                -webkit-box-sizing:border-box;
                box-sizing:border-box;
            }
            head{
                height: 20%;
                width: 100%;
            }
        `}</style>
        </>
    )
}
export default Home;
